import "./expense.css";

function expense(){
    return(
        <div>
            <div className="card">
                <div className="expense-title">Food</div>
                <div className="expense-price">Rs./ - 100</div>
                <div className="expense-date">March 02 2021</div>
            </div>
        </div>
    );
}
